import React from 'react';

function Auth() {
  return (
    <div className="flex justify-center flex-col h-[80vh]">
      <div className="mx-auto p-16 rounded-lg border border-red-300">
        <div className="justify-center">
          <h1 className="font-bold font-MartianMono text-lg">
            Bon retour parmi nous !
          </h1>
          Nous sommes très excités de vous voir à nouveau
        </div>
        <form>
          EMAIL OU NUMÉRO DE TÉLÉPHONE MOT DE PASSE Mot de passe oublié ? Login
        </form>
        <div>Pas encore de compte ? S&apos;enregistrer</div>
      </div>
    </div>
  );
}

export default Auth;
